import React from 'react';
  export default function Act_spawn(w_spawn) {
    switch(w_spawn){
        case w_entity:
            return <span><>w_entity</></span>
        case w_arrows:
            return <span><>w_arrows</></span>
        case w_switch:
            return <span><>w_switch</></span>
        case w_onoff:
            return <span><>w_onoff</></span>
        case w_panel:
            return <span><>w_panel</></span>
        
    
    }

  }
